import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Exercice1 from './components/Exercice/Exo1/Exo1';
import Result from './components/Listes/Result';
const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Accueil">
        <Stack.Screen name="Accueil" component={Exercice1} /> 
        <Stack.Screen name="Exo2" component={Exercice1} /> 
        <Stack.Screen name="film/:id" component={Result} /> 
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
